import React from 'react';
import Switch from '@mui/material/Switch';
import FormControlLabel from '@mui/material/FormControlLabel';
import Box from '@mui/material/Box';

function SwitchCard() {
  
 
  return (
    <Box>
      <FormControlLabel
        control={
          <Switch
            color="warning"
          />
        }
      />
    </Box>
  );
}

export default SwitchCard;
